import React, { useEffect, useState } from "react";
import { facebook, google, login } from "../assets";
import { useAuthState } from "react-firebase-hooks/auth";
import {
  auth,
  loginWithEmail,
  signInWithGoogle,
  logout,
} from "../firebase/Firebase";
import { Link, useNavigate } from "react-router-dom";

export const Login = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [user, loading, error] = useAuthState(auth);
  const [loader, setLoader] = useState(false);
  const navigate = useNavigate();
  useEffect(() => {
    if (loading) {
      setLoader(true);
      return;
    }
    if (user) {
      setLoader(false);
      //   navigate(-1);
      console.log(user);
    }
  }, [user, loading]);

  return (
    <div className="w-fit py-20 flex gap-8 mx-auto items-center">
      {loader ? <div>Loading</div> : <></>}
      <div className="absolute right-0 top-24">
        <span>New User?</span>
        <span>Sign Up</span>
      </div>
      <div>
        <img src={login} alt="" className="w-[30rem]" />
      </div>
      <div className="flex flex-col gap-8 w-[40rem">
        <div className="flex flex-col gap-1">
          <h1 className="text-3xl font-bold font-bodyFont tracking-wider">
            Welcome Back!
          </h1>
          <span className="font-light text-base text-gray-500">
            Login to continue
          </span>
        </div>
        <div className="flex flex-col gap-6">
          <input
            type="text"
            placeholder="Email"
            className="border border-gray-400 px-4 py-2 w-full focus-visible:outline-green-600"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
          <input
            type="password"
            placeholder="Password"
            className="border border-gray-400 px-4 py-2 w-full focus-visible:outline-green-600"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
        </div>
        <div className="flex gap-10 items-center justify-between">
          <button
            onClick={() => loginWithEmail(email, password)}
            className="w-48 text-base uppercase text-white tracking-wider font-titleFont font-medium py-3 bg-green-500 hover:bg-green-600 duration-200 rounded-full"
          >
            Login
          </button>
          {/* <Link to="/reset"> */}
          <span className="uppercase relative font-titleFont tracking-wider text-xs font-medium text-gray-500 hover:text-black after:content-[''] after:h-px after:w-0 hover:after:w-full after:duration-300 duration-300 after:bg-black cursor-pointer after:absolute after:bottom-0 after:left-0">
            forgot password?
          </span>
          {/* </Link> */}
        </div>
        <div className="flex gap-20 items-center">
          <span className=" tracking-wider text-gray-500 font-titleFont font-medium text-sm">
            Login with
          </span>
          <div className="flex gap-4">
            <div
              onClick={signInWithGoogle}
              className="rounded-full flex items-center justify-center bg-gray-100 p-3 w-full hover:bg-gray-200 duration-200 cursor-pointer"
            >
              <img src={google} className="w-6" alt="" />
            </div>
            <div className="rounded-full bg-gray-100 flex items-center justify-center p-3 w-full hover:bg-gray-200 duration-200 cursor-pointer">
              <img src={facebook} className="w-5" alt="" />
            </div>
          </div>
        </div>
        <div onClick={logout}>SIGNOUT</div>
      </div>
    </div>
  );
};
